const HomePage = () => {
    const [selectedPlayers, setSelectedPlayers] = useState(Array(9).fill(null));
    const [dropdownIndex, setDropdownIndex] = useState(null);
    const [searchQuery, setSearchQuery] = useState("");
    const [playerList, setPlayerList] = useState(allPlayers);
    const [result, setResult] = useState(null);
  
    const handleDropdown = (index) => {
      setDropdownIndex(index);
    };
  
    const handleSearch = (e) => {
      setSearchQuery(e.target.value);
      const filteredPlayers = allPlayers.filter((player) =>
        player.toLowerCase().includes(e.target.value.toLowerCase())
      );
      setPlayerList(filteredPlayers);
    };
  
    const handlePlayerSelect = (player, index) => {
      const updatedPlayers = [...selectedPlayers];
      updatedPlayers[index] = player;
      setSelectedPlayers(updatedPlayers);
      setDropdownIndex(null); // Close the dropdown after selecting
    };
  
    const renderPlayerBox = (index) => {
      const player = selectedPlayers[index];
      return (
        <div className="player-box" key={index}>
          <button
            className="dropdown-button"
            onClick={() => handleDropdown(index)}
          >
            {player ? player : "Select Player"}
          </button>
          {dropdownIndex === index && (
            <div className="dropdown-menu">
              <input
                type="text"
                className="dropdown-search"
                placeholder="Search players..."
                value={searchQuery}
                onChange={handleSearch}
              />
              <ul>
                {playerList.map((player) => (
                  <li
                    key={player}
                    onClick={() => handlePlayerSelect(player, index)}
                  >
                    {player}
                  </li>
                ))}
              </ul>
            </div>
          )}
        </div>
      );
    };
    const handleSendToBackend = async () => {
      setResult(null);
      const filteredPlayers = selectedPlayers.filter((player) => player !== null);
      //const filteredPlayers = ["Abalos, Jordan", "Abbott, Maddy", "Abbott, Symone", "Abalos, Jordan", "Abbott, Maddy", "Abbott, Symone"];
  
      if (filteredPlayers.length < 6) {
        alert("Please select at least 6 players before submitting!");
        return;
      }
  
      try {
        const response = await axios.post("http://localhost:5000/predict", {
          filteredPlayers,
        });
        if (response.data.success) {
          if (response.data.prediction == 1){
            setResult("Successful!");
          }else if (response.data.prediction == 0){
            setResult("Not Successful");
          }
          
        } else {
          console.error("Error in prediction:", response.data.error);
          alert("Prediction failed");
        }
      } catch (error) {
        console.error("Error sending data to backend:", error);
        alert("Failed to get prediction. Please try again later.");
      }
    };
  
    return (
      <div>
        <h1>PerfMatch</h1>
        <div className="player-boxes">
          {selectedPlayers.map((_, index) => renderPlayerBox(index))}
        </div>
        {/* Submit button */}
        <div className="submit-section">
          <button className="submit-button" onClick={handleSendToBackend}>
            Get Team Success Prediction
          </button>
        </div>

        {/* Result Section */}
        {result !== null && (
          <div className="result-section">
            <h2>Team Success Prediction:</h2>
            <p>{result}</p>
          </div>
        )}
        <div className="substitute-note">
          <p>
            The last 3 players are substitutes, and choosing them is optional.
          </p>
        </div>
        <Footer /> {/* Include Footer here if it's needed */}
      </div>
    );
  };
  
  export default HomePage;